import React from 'react'

const HeaderBrowse = () => {
  return (
    <div className='absolute  py-1 z-10 w-screen bg-black bg-opacity-80 flex justify-between'>
      <img className='w-28' src="https://cdn.cookielaw.org/logos/dd6b162f-1a32-456a-9cfe-897231c7763c/4345ea78-053c-46d2-b11e-09adaef973dc/Netflix_Logo_PMS.png" alt="netflix-logo"/>
      <button type='button' className='bg-red-500 text-white p-2'>Sign Out</button>
    </div>
  )
}

export default HeaderBrowse;
